Defendant in custody.   
Count 1 - Defendant is sentenced to the Wisconsin State Prison System for a total of six (6) years.   Three (3) years initial confinement, followed by three (3) years extended supervision, consecutive to any revocation sentence.  
Count 2 - Defendant is sentenced to the Wisconsin State Prison System for a total of two (2) years.   One (1) year initial confinement, followed by one (1) year extended supervision, concurrent with Count 1.   
Count 3 - Defendant is sentenced to thirty (30) days incarceration concurrent with counts 1 and 2.    Conditions of extended supervision are:
1) Absolute sobriety; 
2) AODA assessment and follow through;
3) Submit to random urine screens and pay for same;
4) Take all medications as directed by a medical doctor and notifiy his agent immediately of all prescription changes;
5) Pay supervision fees in an amount to be determined by DOC; 
6) Pay costs of action.  
Court finds the defendant is eligible for the Challenge Incarceration Program and the Substance Abuse Program.   
Defendant is entitled to 52 days sentence credit.  
Minutes.
